octave_code:
% side length
s = 2;
% radius of circumscribed circle
R = s/(2*sin(pi/8));

% angles
theta = (0:7)*pi/4 + pi/8; % 22.5°, 67.5°, ...
% compute vertices
x = R*cos(theta);
y = R*sin(theta);

% assign vertices
A=[x(1),y(1)]; B=[x(2),y(2)]; C=[x(3),y(3)]; D=[x(4),y(4)];
E=[x(5),y(5)]; F=[x(6),y(6)]; G=[x(7),y(7)]; H=[x(8),y(8)];

% intersection of lines A-D and C-H
Q = line_intersection(A,D,C,H);
% intersection of lines H-E and D-G
Rint = line_intersection(H,E,D,G);

% area of quadrilateral D-Q-H-R
poly = [D; Q; H; Rint];
area = polyarea(poly(:,1),poly(:,2));

fprintf('Area of shaded region: %.6f\n',area);

% function to compute intersection of two lines defined by points p1,p2 and p3,p4
function P = line_intersection(p1,p2,p3,p4)
    % line p1-p2: p1 + t*(p2-p1)
    % line p3-p4: p3 + u*(p4-p3)
    A = [p2-p1, -(p4-p3)];
    b = p3 - p1;
    t = A\b;
    P = p1 + t(1)*(p2-p1);
end

