pkg load optim;

% Right triangle vertices
A = [0,0];
B = [2*sqrt(3),0];
C = [0,5];

% Function to compute residuals
function F = eq_res(vars)
  x = vars(1);
  y = vars(2);
  t = vars(3);
  % Points
  P = [x,0];
  Q = [0,y];
  R = [2*sqrt(3)*(1-t), 5*t];
  % Distances squared
  dPQ = sum((P-Q).^2);
  dQR = sum((Q-R).^2);
  dRP = sum((R-P).^2);
  F = [dPQ - dQR; dPQ - dRP];
end

% Search for solutions
solutions = [];
tol = 1e-6;
maxIter = 1000;
rng(0);
for i=1:maxIter
  % random initial guess within bounds
  x0 = 2*sqrt(3)*rand;
  y0 = 5*rand;
  t0 = rand;
  vars0 = [x0,y0,t0];
  opts = optimset('Display','off','TolFun',1e-12,'TolX',1e-12);
  [vars,~,exitflag] = fsolve(@eq_res,vars0,opts);
  if exitflag>0
    x = vars(1); y = vars(2); t = vars(3);
    % check bounds
    if x>=0 && x<=2*sqrt(3) && y>=0 && y<=5 && t>=0 && t<=1
      % check residual
      F = eq_res(vars);
      if norm(F) < 1e-8
        % check uniqueness
        duplicate = false;
        for k=1:size(solutions,1)
          if norm(solutions(k,:)-vars) < 1e-6
            duplicate = true;
            break;
          end
        end
        if ~duplicate
          solutions = [solutions; vars];
        end
      end
    end
  end
end

% Compute side lengths and areas
areas = [];
for k=1:size(solutions,1)
  x = solutions(k,1); y = solutions(k,2);
  side = sqrt(x^2 + y^2);
  area = sqrt(3)/4 * side^2;
  areas = [areas; area];
end

if isempty(areas)
  disp('No solution found.');
else
  minArea = min(areas);
  fprintf('Minimal area: %.12f\n', minArea);
end

