% Compute remainders for first and second spins
col = mod(wheel,4); % column index (1-3)
row = mod(wheel,5); % row index (1-4)

% Determine shaded squares: rows 3 and 4
shadedRows = [3 4];

% Count outcomes
total = numel(wheel)^2;
shaded = 0;
for i = 1:numel(wheel)
  for j = 1:numel(wheel)
    r = row(j); % row from second spin
    if ismember(r, shadedRows)
      shaded = shaded + 1;
    end
  end
end

prob = shaded / total;
fprintf('Probability of landing on a shaded square: %.4f\n', prob);

